import whatsapp from '../images/ico-whatsapp.png';
import Instagram from '../images/ico-instagram.png';


const Footer = () => {
  return (
    <footer>
        <div className='fo_display'>
          <p>Powered by</p>
          <img src={dh_logo} alt='DH-logo' />
        </div>
        <div >

          <button>hola</button>

        </div>

    </footer>
  )
}

export default Footer
